import React from 'react';
import '../App.css';
import api from '../api'

export class Cups extends React.Component {
    constructor(props) {
        super(props);
        this.state = { products: [] };
    }

    async componentDidMount() {
        await api.getAllProducts().then(products => {
            this.setState({
                products: products.data,
            })
        })
    }
    render() {
        return (
            <div className="contentWrapper">
                {/* <h1></h1> */}
                {this.state.products.map((product, i) => (
                    <div key={i} className="contentBlock">
                        <li><img src={'/imgs/' + product.picture} alt={product.name + ' picture'} /></li>
                        <li>{product.name}</li>
                        <li>{product.type}</li>
                        <li>{product.price}</li>
                    </div>
                ))}
            </div>
        )
    }
}

export default Cups;
